import React from 'react';

const FeaturesSection = () => {
  return (
    <section id="features" className="section">
      <h2>Our Features</h2>
      <p>Explore what Fashion Muse offers:</p>
      <ul style={{ listStyle: 'none', textAlign: 'left', maxWidth: '600px', margin: '0 auto' }}>
        <li>1. AI-Powered Chatbot</li>
        <li>2. Virtual Muscat Assistant</li>
        <li>3. Customizable Avatar</li>
        <li>4. Photo Upload & Fit Suggestions</li>
        <li>5. Seasonal Fashion Guides</li>
        <li>6. Outfit & Cosmetics Matching</li>
        <li>7. Expert Tips & Articles</li>
        <li>8. Direct Shopping Links</li>
        <li>9. Customizable Profiles</li>
      </ul>
    </section>
  );
};

export default FeaturesSection;
